import React from 'react';
import menuList from '../utils/menuList';

function Navbar() {
  const menu = menuList.map((item) => (
    <li className="menu-list">
      { item.title }
    </li>
  ));
  return (
    <div className="navbar">
      <h2>Menu</h2>
      { menu }
    </div>
  );
}

export default Navbar;
